Earlier this year we bought back our #GameFace campaign for a second year, furthering Clinique’s commitment to support women’s confidence through grassroots rugby.🏉💪🏼

After hundreds of entires into our competition to win vital funding, we are excited to announce our four winning clubs:

@brixham_sirens
@sussexuniwomensrugby
@doncasterdemons_womensrugby
@hackneygladies

Swipe to discover why our Game Face Ambassadors chose these four clubs as our worthy winners.

Congratulations to all our teams.👏🏼

